import React, { useState, useEffect} from 'react'

function App() {
  const [data, setData] = useState({});
  useEffect(() => {
    fetch("/page1/").then(res => res.json()).then(
      data => {
        setData(data)
        // console.log(data)
      }
    )
  }, [])

  return (
    <div>
      {(typeof data.body === 'undefined') ? (
        <p>Synching</p>
      ):(
        <p>{data.body}</p>
      )}
    </div>
  )
}

export default App;
